    public class FoundationCreator
    {
        private readonly ElevationsDbContext _context;

        public FoundationCreator(ElevationsDbContext context)
        {
            _context = context;
        }

        public List<Foundation> Foundations
        {
            get
            {
                return GetInitialFoundations();
            }
        }

        public void Create()
        {
            CreateFoundations();
        }

        private void AddFoundationIfNotExists(Foundation foundation)
        {
            if (_context.Apartments.IgnoreQueryFilters().Any(l => l.Name == foundation.Description))
            {
                return;
            }

            _context.Foundation.Add(foundation);
            _context.SaveChanges();
        }

        private void CreateFoundations()
        {
            foreach (Foundation foundation in Foundations)
            {
                AddFoundationIfNotExists(foundation);
            }
        }

